import React from 'react';
import { createUserProject } from '../../store/projects/actions';
import { 
  Card,
  CardTitle,
  CardSubTitle,
  CardButtons,
  Members, 
  CardForm, 
} from '../UI/Card/Card';
import MiniButton from '../UI/MiniButton/MiniButton';
import LineInput from '../UI/LineInput/LineInput';

const CreateProjectForm = (props) => (
  <Card>
    <CardTitle>Добавление проекта</CardTitle>
    
    <LineInput type="text" placeholder="Название проекта"/>
    
    <CardForm>
      <CardButtons>
        
        <MiniButton onClick={() => {
          this.props.createUserProject({name: 'XXXXX'});
        }}>
          Добавить
        </MiniButton>
      </CardButtons>
    </CardForm>
  </Card>
);

export default createUserProject;
